# s: "cbaebabacd" p: "abc"
# s1 = ""
# p2 = ""
# s2 = ""
# p2 = ""
s2 = ""
p2 = "bbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbb"
class Solution(object):
    def findAnagrams(self, s, p):
        possiblities = []
        cP = len(p)
        cS = len(s)
        dP = self.mapify(p)
        indicies = []
        prevCondition = False
        i = 0 
        while i <  cS - (cP - 1):
            substring = s[i:i+cP]
            if prevCondition and s[i - 1] == substring[-1]:
                prevCondition = True
                indicies.append(i)

            elif (prevCondition and s[i - 1] != substring[-1] and substring[-1] not in dP):
                prevCondition = False
                i = i + cP
                continue
                
            # only mapify when you have to
            elif self.isAnagram(dP, self.mapify(substring)):
                prevCondition = True
                indicies.append(i)

            else:
                prevCondition = False
            i += 1
        return indicies
    
    def mapify(self, ls):
        d = {}
        for i in ls:
            if i in d:
                d[i] += 1
            else:
                d[i] = 1
        return d
        
    def isAnagram(self, d1, d2):
        for i in d1:
            if i not in d2 or d1[i] != d2[i]:
                return False
        return True

s = Solution()
print(s.findAnagrams(s2, p2))
